import React from "react";
import './loggedinpage.scss';

const loggedinpage = () =>{
    return(<div className="loggedin-page-container">
        <div className="loggedin-page-top-container">
            <span className="loggedin-page-top-left-logo"></span>
            <span className="">Control Panel</span>
            <span className="loggedin-page-top-right-logo"></span>
        </div>

        <div className="loggedin-page-middle-container">
            <div className="loggedin-page-middle-left-options-container">
                <div className="loggedin-page-middle-left-option-1"></div>
                <div className="loggedin-page-middle-left-option-2"></div>
                <div className="loggedin-page-middle-left-option-3"></div>
            </div>
        </div>

        <div className="loggedin-page-bottom-container"></div>
    </div>
    );
}

export default loggedinpage;
